export const contactsReducer=(state:ContactType[],action:ActionType)=>{
    switch(action.type){
        case 'add':{
            let data=action.payload?.data
            let newState=[...state]
            newState.unshift(data)
            return newState

        }
        case 'remove':{
            let id=action.payload?.id
            let newState=[...state]
            newState=newState.filter(item=>item.id !== id)
            return  newState

        }
    }

    return state
}

export const useContactList=()=>{
    return useReducer(contactsReducer,initialState)
}